import React, { FC, useState, useEffect } from 'react';
import axios from "axios";
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { CardCarWrapper } from './CardCar.styled';
import ListGroup from 'react-bootstrap/ListGroup';

interface CardCarProps {
   img: string;

}

const CardCar: FC<CardCarProps> = ({img}) => (
 <CardCarWrapper>
    <Card style={{ width: '18rem', backgroundColor: '#E3E8EB'}}>
      <Card.Img variant="top" src={img} />
      <Card.Body >
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text>
      </Card.Body>
      <ListGroup className="list-group-flush"  >
        <ListGroup.Item style={{backgroundColor: '#E3E8EB'}}>Cras justo odio</ListGroup.Item>
        <ListGroup.Item style={{backgroundColor: '#E3E8EB'}}>Dapibus ac facilisis in</ListGroup.Item>
        <ListGroup.Item style={{backgroundColor: '#E3E8EB'}}>Vestibulum at eros</ListGroup.Item>
        <ListGroup.Item style={{backgroundColor: '#E3E8EB'}}>Vestibulum at eros</ListGroup.Item>

      </ListGroup>

    </Card>
 </CardCarWrapper>
);

export default CardCar;
